import React from "react";
import emailjs from "emailjs-com";
// import { Link } from 'react-router-dom';
import {Helmet} from "react-helmet";
// import Form from 'customisable-contact-form';
// import {Heading, FirstName, LastName, Email, Message, SubmitButton} from 'customisable-contact-form'
export default function Contact() {

  return (

    <div className="containers">
          <Helmet>
                <style>{'body { background-color: #f2f3f5; }'}</style>
            </Helmet>

          <div class="container">
          <div class="row">
          <div style={{marginTop:"4%"}}>
          <p style={{textAlign:"center",fontSize:"30px",fontFamily:"poppins"}}>BOOK A CALL TODAY</p>
          <p style={{textAlign:"center",fontSize:"15px"}}>Talk with Cutoutwiz team today and get to know more about The KOW Company</p>
    
       
<div class="calendly-inline-widget" data-url="https://calendly.com/ashikahmedfifa/30min"
 style={{minWidth:"320px",height:"630px"}} ></div>


        </div>
        </div>
        </div>
    
    <br/>
</div>

  );
  
}
